import { slide as Menu } from "react-burger-menu";
import {
  BrowserView,
  MobileView,
  isBrowser,
  isMobile
} from "react-device-detect";

class SlideMenu extends React.Component {
  showSettings(event) {
    event.preventDefault();
  }

  render() {
    // NOTE: You also need to provide styles, see https://github.com/negomi/react-burger-menu#styling
    return (
      <BrowserView>
        <Menu>
          <br />
          <br />
          <a style={{ color: "white" }}>Guides</a>
          <br />
          <a className="menu-item" href="/"></a>
          <a className="menu-item" href="/about"></a>
          <a className="menu-item" href="/contact"></a>

          <br />
          <br />
          <a style={{ color: "white" }}>Guides</a>
          <br />

          <a
            id="home"
            className="menu-item"
            href="/listening-exercises/spanish-curse-words"
          >
            Spanish Curse Words
          </a>
          <a className="menu-item" href="/about"></a>
          <a className="menu-item" href="/contact"></a>
          <a className="menu-item--small" href=""></a>
        </Menu>
      </BrowserView>
    );
  }
}

export default SlideMenu;
